import React from "react";

const InboxItem = ({token, post, setPosts}) => {
    console.log("KEYSEARCH", post)
    return (<>
        {post.isAuthor ? ( 
            <div>
                <div>{post.title}</div>
                <div>{post.author.username}</div>
                <div>{post.messages}</div>
            </div>) : ( 
            <div>
                <div>{post.title}</div>
                <div>{post.author.username}</div>
                <div>{post.messages}</div>
            </div>)}
        </>
    )
};

export default InboxItem;
